import React, { Component, Fragment } from 'react';
import { Menu, Icon } from 'antd';
import logo from './logo.png';
import './style.css';

class Header extends Component{

constructor(props){
    super(props)
   this.state={
    
   list:[

     {

       icon:'a',
       key:'mail',
       value:'hello world'
     },
     {

      icon:'mail',
      key:'c',
      value:'hello world'
    },
    {

      icon:'mail',
      key:'b',
      value:'hello world'
    },
    {

     icon:'mail',
     key:'a',
     value:'hello world'
   },

   ]
   }}


getItem(){
  return this.state.list.map(item=>{
    return  <Menu.Item key={item.key}>
              <Icon type={item.icon} />
                    {item.value}
                    </Menu.Item>
  }
  )
}
   

render(){
    return (
      <Fragment>
      <img src={logo} alt="logo" className="logo" />
      <Menu mode="horizontal">
      {this.getItem()}
    </Menu>
    </Fragment>
 )
}
}


export default Header;
